  }

  async componentDidMount() {
    const dataUsers = await getUser();
    console.log(dataUsers);
  }

  render() {
    return (
      <div data-testid="page-profile">
        <p>Profile</p>
        <Header />
      </div>);
  }
}
export default Profile;
